class Solution:
    #beat 3%
    #虽然接受但是很慢
    def findRadius_bad(self, houses, heaters):
        """
        :type houses: List[int]
        :type heaters: List[int]
        :rtype: int
        """
        #判断半径r是否合理 方法1：太慢
        def is_valid_bad(houses, heaters, r):
            judge_result = True
            warm_area = []
            heaters_num = len(heaters)
            houses_num = len(houses)
            for i in range(heaters_num):
                warm_area.append([heaters[i]-r,heaters[i]+r])

            warm_area_len = len(warm_area)
            for i in range(houses_num):
                #判断houses[i]是否warm，二分查找更快
                valid_sign = False
                for j in range(warm_area_len):
                    if houses[i]>=warm_area[j][0] and houses[i]<=warm_area[j][1]:
                        valid_sign = True
                        break
                #不符合
                if not valid_sign:
                    judge_result = False
                    break
            return judge_result

        #判断半径r是否合理 方法2：加速
        def is_valid(houses, heaters, r):
            judge_result = True
            heaters_num = len(heaters)
            houses_num = len(houses)

            pre_h = 0   #当前houses的前一个heater
            next_h = 0  #记录当前houses的下一个heater
            for i in range(houses_num):
                #houses[i]太大
                if houses[i]>heaters[heaters_num-1]:
                    if houses[i]>heaters[heaters_num-1]+r:
                        judge_result = False
                        break
                #houses[i]太小
                if houses[i]<heaters[0]:
                    if houses[i]<heaters[0]-r:
                        judge_result = False
                        break
                ##houses[i]在两个heater中间
                while next_h<heaters_num and heaters[next_h]<=houses[i]:
                    pre_h = next_h
                    next_h = next_h+1

                if houses[i]<=heaters[pre_h]+r or (next_h<heaters_num and houses[i]>=heaters[next_h]-r):
                    continue
                else:
                    print("r:",r,"houses[i]:",houses[i],"heaters[pre_h]:",heaters[pre_h])
                    judge_result = False
                    break
            return judge_result
       
        #开始
        houses.sort()
        heaters.sort()

        #选择r 方法1：太慢，从0开始递增
        """
        r = 0
        while not is_valid(houses, heaters, r):
            r = r+1
        """

        #选择r 方法2：在挑选r时加速
        step = (max(houses) - min(houses))//100
        if not step>1000:
            step = 1000
        big_r = 0
        small_r = 0
        while not is_valid(houses,heaters,big_r):
            small_r = big_r
            big_r = big_r + step

        print("\n范围：",small_r,big_r)

        r = (small_r+big_r)//2
        min_valid_r_flag = False
        while not min_valid_r_flag:
            if is_valid(houses,heaters,r):
                big_r = r
                if not is_valid(houses,heaters,r-1):
                    min_valid_r_flag = True
                    break
            else:
                small_r = r
            r = (small_r+big_r)//2
        print(r)
        return r

    #beat 94%
    def findRadius(self, houses, heaters):
        #开始
        houses.sort()
        heaters.sort()

        heaters_num = len(heaters)
        houses_num = len(houses)

        min_r = 0
        pre_h = 0   #当前houses的前一个heater
        next_h = 0  #记录当前houses的下一个heater
        for i in range(houses_num):
            #houses[i]太大
            if houses[i]>heaters[heaters_num-1] and houses[i]-heaters[heaters_num-1]>min_r:
                min_r = houses[i]-heaters[heaters_num-1]
            #houses[i]太小
            if houses[i]<heaters[0] and heaters[0]-houses[i]>min_r:
                min_r = heaters[0]-houses[i]
            #houses[i]在两个heater中间
            while next_h<heaters_num and heaters[next_h]<=houses[i]:
                pre_h = next_h
                next_h = next_h+1

            if houses[i]-heaters[pre_h]>min_r or (next_h<heaters_num and heaters[next_h]-houses[i]>min_r):
                min_r=max(min_r,min(houses[i]-heaters[pre_h],heaters[next_h]-houses[i]))
        print(min_r)
        return min_r



